<?php
include __DIR__ . '/header.php';
include __DIR__ . '/sidebar.php';

// Veritabanı bağlantısı
require_once __DIR__ . '/../includes/database.php';

// Oyun sayısını çek
$total_games = mysqli_fetch_assoc(mysqli_query($conn, "SELECT COUNT(*) as count FROM games"))['count'];

// Blog sayısını çek
$total_blogs = mysqli_fetch_assoc(mysqli_query($conn, "SELECT COUNT(*) as count FROM blogs"))['count'];

// Aktif bot sayısı (sabit)
$active_bots = 8;

// Son 30 günde eklenen oyunlar (Oyun Giriş/Çıkış için)
$last_month_games = mysqli_fetch_assoc(mysqli_query($conn, "SELECT COUNT(*) as count FROM games WHERE created_at >= DATE_SUB(NOW(), INTERVAL 30 DAY)"))['count'];
$last_month_blogs = mysqli_fetch_assoc(mysqli_query($conn, "SELECT COUNT(*) as count FROM blogs WHERE created_at >= DATE_SUB(NOW(), INTERVAL 30 DAY)"))['count'];

// Oyun giriş/çıkış verisi
$game_inflows = $last_month_games; // Örnek olarak son 30 gün eklenen oyunlar
$game_inflows_percentage = $total_games > 0 ? round(($last_month_games / $total_games) * 100, 1) : 0;

// Yüzde değişiklikleri
$games_percentage = $total_games > 0 ? round(($last_month_games / $total_games) * 100, 1) : 0;
$blogs_percentage = $total_blogs > 0 ? round(($last_month_blogs / $total_blogs) * 100, 1) : 0;

// Son 10 oyunu çek
$result = mysqli_query($conn, "SELECT uuid, name, created_at, category FROM games ORDER BY created_at DESC LIMIT 10");
$games = [];
while ($row = mysqli_fetch_assoc($result)) {
    $games[] = $row;
}
?>

